from sklearn.compose import ColumnTransformer
from sklearn.preprocessing import OrdinalEncoder
from sklearn.pipeline import make_pipeline
from xgboost import XGBRegressor
import pandas as pd
import numpy as np
from workalendar.europe import France
import seaborn as sns
import matplotlib.pyplot as plt
import streamlit as st


df_train = pd.read_parquet("data/train.parquet")
df_test = pd.read_parquet("data/final_test.parquet")


def bike_count_plot(df_train):
    #Time Series Plot of Bike Counts
    
    df = df_train.sample(frac=0.001, random_state=42)  # Adjust the fraction as needed
    df = df.sort_values(by='date')



    plt.rcParams['agg.path.chunksize'] = 10000

    plt.figure(figsize=(12, 6))
    plt.plot(df['date'], df['bike_count'], label='Bike Count')
    plt.title('Time Series Plot of Bike Counts')
    plt.xlabel('Date')
    plt.ylabel('Bike Count')
    plt.legend()
    
    st.pyplot(plt)

def bike_count_dist(df):
    plt.figure(figsize=(10, 6))
    plt.hist(df['bike_count'], bins=30, color='skyblue', edgecolor='black')
    plt.title('Distribution of Bike Counts')
    plt.xlabel('Bike Count')
    plt.ylabel('Freqdata:image/png;base64,')
    st.pyplot(plt)


def bike_count_location(df):
    # Bike Counts Across Different Locations
    plt.figure(figsize=(14, 6))
    sns.barplot(x='site_name', y='bike_count', data=df, ci=None, palette="coolwarm")
    plt.title('Average Bike Counts Across Different Locations')
    plt.xlabel('Location')
    plt.ylabel('Average Bike Count')
    plt.xticks(rotation=45, ha='right')
    st.pyplot(plt)



def split_date(data):
    
    # Get integer values of hours, day, month and year from the date column
    data = data.copy()
    
    data["hour"] = data["date"].dt.hour
    data["day"] = data["date"].dt.day
    data["weekday"] = data["date"].dt.weekday
    data["month"] = data["date"].dt.month
    data["year"] = data["date"].dt.year
    
    # Mark the days which are bank holidays in France
    cal = France()
    data['bank_holiday'] = data['date'].apply(lambda x: cal.is_holiday(x))

    # Drop date
    return data.drop(columns=["date"])


def merge_weather_data(data):
    file_path = "data/external_data.csv"
    weather_data = pd.read_csv(file_path, parse_dates=["date"])

    data['date'] = pd.to_datetime(data['date']).astype('datetime64[ns]')
    weather_data['date'] = pd.to_datetime(weather_data['date']).astype('datetime64[ns]')

    data = data.copy()

    # Merge weather data and save information on original order of tuples
    data["sorting_index"] = np.arange(data.shape[0])
    data = pd.merge_asof(
        data.sort_values("date"), 
        weather_data[["date", "t", 'u', 'ff', 'td', 'raf10', 'rafper']].sort_values("date"), 
        on="date"
    )

    # Sort the dataframe to the original order
    data = data.sort_values("sorting_index")
    del data["sorting_index"]
    return data


# Get training data
df_train = merge_weather_data(df_train)

# Plot bike counts
bike_count_plot(df_train)

# Plot bike count distribution
bike_count_dist(df_train)

# Plot bike count based on location
bike_count_location(df_train)

date_values = split_date(df_train[["date"]])
df_train = pd.concat([df_train, date_values], axis=1)

# Get testing data
df_test = merge_weather_data(df_test)
test_date_values = split_date(df_test[["date"]])
df_test = pd.concat([df_test, test_date_values], axis=1)

# Split X and y from training data
y_train = df_train['log_bike_count']
X_train = df_train.drop('log_bike_count', axis=1)

# Specify column to encode and passthrough
categorical_encoder = OrdinalEncoder()
categorical_cols = ["counter_name", "bank_holiday"]
passthrough_cols = ['latitude', 'longitude', 't', 'u', 'ff', 'td', 'raf10', 'rafper', 'month', 'weekday', 'hour', 'day']

preprocessor = ColumnTransformer(
    [
        ("categorical", categorical_encoder, categorical_cols),
        ('passthrough', 'passthrough', passthrough_cols)
    ]
)


# Streamlit sliders for hyperparameters
st.sidebar.header("XGBoost Hyperparameters")
learning_rate = st.sidebar.slider("Learning Rate", 0.01, 0.5, 0.1, 0.01)
max_depth = st.sidebar.slider("Max Depth", 1, 20, 8)
n_estimators = st.sidebar.slider("Number of Estimators", 100, 1000, 500)
min_child_weight = st.sidebar.slider("Min Child Weight", 1, 10, 5)
reg_alpha = st.sidebar.slider("Regularization Alpha", 0.0, 1.0, 0.1, 0.01)
colsample_bytree = st.sidebar.slider("Colsample by Tree", 0.1, 1.0, 0.8)

# Initialize XGBRegressor with hyperparameters from sliders
regressor = XGBRegressor(
    learning_rate=learning_rate,
    max_depth=max_depth,
    n_estimators=n_estimators,
    min_child_weight=min_child_weight,
    reg_alpha=reg_alpha,
    colsample_bytree=colsample_bytree
)

# Button to trigger training and prediction
if st.button("Train Model and Predict"):
    # Create pipeline and train
    pipeline = make_pipeline(preprocessor, regressor)
    pipeline.fit(X_train, y_train)

    # Predict on test data
    y_pred = pipeline.predict(df_test)

    # Display results and allow download
    st.subheader("Prediction Results")
    st.write(y_pred)

    # Create DataFrame for final prediction
    final_pred = pd.DataFrame(dict(Id=np.arange(y_pred.shape[0]), log_bike_count=y_pred))

    # Downloadable CSV
    st.download_button(
        label="Download Prediction Results",
        data=final_pred.to_csv(index=False).encode('utf-8'),
        file_name="submission.csv",
        mime="text/csv"
    )
else:
    st.warning("Please upload both training and test datasets.")

